import logo from './logo.svg';
import './App.css';
import React from 'react';
import styled from "styled-components";
import Detail from './Detail';

const Title = (props) => {
  return (
    <h1>내 일주일은?</h1>
  );
}

function App() {
  return (
    <div className="App">
      <Title/>
    </div>
  );
}

export default App;
